{
  "ubx_message_extraction": {
    "name": "UBX-NAV-GEOFENCE",
    "class_id": "0x01",
    "message_id": "0x39",
    "message_type": "periodic_polled",
    "payload_length": {
      "variable": {
        "base": 8,
        "formula": "8 + numFences*2"
      }
    },
    "fields": [
      {
        "byte_offset": 0,
        "name": "iTOW",
        "data_type": "U4",
        "unit": "ms",
        "description": "GPS time of week of the navigation epoch."
      },
      {
        "byte_offset": 4,
        "name": "version",
        "data_type": "U1",
        "description": "Message version (0x00 for this version)"
      },
      {
        "byte_offset": 5,
        "name": "status",
        "data_type": "U1",
        "description": "Geofencing status\n0 - Geofencing not available or not reliable\n1 - Geofencing active"
      },
      {
        "byte_offset": 6,
        "name": "numFences",
        "data_type": "U1",
        "description": "Number of geofences"
      },
      {
        "byte_offset": 7,
        "name": "combState",
        "data_type": "U1",
        "description": "Combined (logical OR) state of all geofences\n0 - Unknown\n1 - Inside\n2 - Outside"
      },
      {
        "byte_offset": 8,
        "name": "repeated_group",
        "data_type": {
          "array_of": {
            "elements": [
              {
                "byte_offset": 0,
                "name": "state",
                "data_type": "U1",
                "description": "Geofence state\n0 - Unknown\n1 - Inside\n2 - Outside"
              },
              {
                "byte_offset": 1,
                "name": "id",
                "data_type": "U1",
                "description": "Geofence ID (0 = not available)"
              }
            ]
          },
          "count_field": "numFences"
        }
      }
    ]
  }
}
